// event
if (globalVars("inviteManagerRanAlready") == null) {
    const Discord = require("discord.js");
    var delay = 1000;
    var inviteDatabase = {};
    var checkUpdates = true;
    var dmOwnerOnMissingPermission = false;

    Actions.storeValue(true, 3, "inviteManagerRanAlready", cache);

    const fs = require('fs');
    const request = require('request');

    var requiredIntents = ["GUILD_MEMBERS", "GUILD_INVITES"];
    var intentCheck = new Discord.Intents(DBM.Bot.intents()).toArray();
    requiredIntents.forEach(intent => {
        if (!intentCheck.includes(intent)) {
            console.log(`[Invite Manager] You don't have the ${intent} intent enabled!`)
        }
    })

    if (checkUpdates) {
        request('https://raw.githubusercontent.com/ItzPike/DBM-Rawdata-Releases/master/Invite%20Manager/versionCheck.json', function(error, response, body) {
            if (response.statusCode == 200) {
                var allVersions = JSON.parse(body);

                var commandVersions = {};
                var eventVersions = {};
                var commandKeys = [];
                var eventKeys = [];

                allVersions["commands"].forEach(commandVer => {
                    commandVersions[commandVer[0]] = commandVer[1];
                    commandKeys.push(commandVer[0]);
                });

                allVersions["events"].forEach(eventVer => {
                    eventVersions[eventVer[0]] = eventVer[1];
                    eventKeys.push(eventVer[0])
                })

                fs.readFile("./data/commands.json", async function(err, data) {
                    var data = JSON.parse(data);

                    var systemCommands = await data.filter(command => command != null && commandKeys.includes(command["_id"]));

                    for (i = 0; i < systemCommands.length; i++) {
                        var systemActionFind = await systemCommands[i]["actions"].filter(actionInfo => actionInfo.name = "Run Script" && actionInfo.code != null);

                        if (systemActionFind.length != 0) {
                            var versionCheckSplit = systemActionFind[0].code.split("VersionCheck:");
                            if (versionCheckSplit[1] != null && versionCheckSplit[1] != commandVersions[systemCommands[i]["_id"]] && !isNaN(versionCheckSplit[versionCheckSplit.length - 1])) {
                                console.log(`[Invite Manager] The command ${systemCommands[i]["name"]} needs an update!`)
                            }
                        }
                    }
                })

                fs.readFile("./data/events.json", async function(err, data) {
                    var data = JSON.parse(data);

                    var systemEvent = await data.filter(event => event != null && eventKeys.includes(event["_id"]));
                    for (i = 0; i < systemEvent.length; i++) {
                        var systemEventFind = await systemEvent[i]["actions"].filter(actionInfo => actionInfo.name = "Run Script" && actionInfo.code != null);

                        if (systemEventFind.length != 0) {
                            var versionCheckSplit = systemEventFind[0].code.split("VersionCheck:");
                            if (versionCheckSplit != null && versionCheckSplit[versionCheckSplit.length - 1] != eventVersions[systemEvent[i]["_id"]] && !isNaN(versionCheckSplit[versionCheckSplit.length - 1])) {
                                console.log(`[Invite Manager] The event ${systemEvent[i]["name"]} needs an update!`)
                            }
                        }
                    }
                })
            }
        });
    }

    Actions.inviteModifyData = function(userID, guildID, valueChange, invalidReal) {
        invalidReal = invalidReal;
        if (invalidReal == 1 || invalidReal == 0) {
            if (invalidReal == 1) {
                invalidReal = "real";
            } else {
                invalidReal = "invalid";
            }

            if (!isNaN(valueChange)) {

                if (!checkProperty(inviterData, guildID)) {
                    inviterData[guildID] = {};
                }

                if (!checkProperty(inviterData[guildID], userID)) {
                    inviterData[guildID][userID] = {
                        "invites": [],
                        "data": {
                            "real": 0,
                            "invalid": 0
                        }
                    };
                }

                inviterData[guildID][userID]["data"][invalidReal] += parseInt(valueChange);
                if (inviterData[guildID][userID]["data"][invalidReal] < 0) {
                    inviterData[guildID][userID]["data"][invalidReal] = 0;
                }

                writeToData("inviteManagerData", invitePData, "invitePData");

                return "success";

            } else {
                return "failed - Invalid value";
            }
        } else {
            return "failed - Invalid value change selection";
        }
    }

    Actions.inviteGet = function(userID, guildID, invalidReal) {
        invalidReal = invalidReal;
        if (invalidReal == 1 || invalidReal == 0) {
            if (invalidReal == 1) {
                invalidReal = "real";
            } else {
                invalidReal = "invalid";
            }

            if (checkProperty(inviterData, guildID) && checkProperty(inviterData[guildID], userID)) {
                return inviterData[guildID][userID]["data"][invalidReal];
            } else {
                return "failed - No data found";
            }
        } else {
            return "failed - Invalid value change selection";
        }
    }

    Actions.fetchDatabase = function() {
        return inviteDatabase;
    }

    client.guilds.cache.forEach(g => {
        g.fetchInvites().then(guildInvites => {
            try {
                inviteDatabase[g.id] = guildInvites;
            } catch (error) {
                console.log(error);
            }
        }).catch(error => {
            if (dmOwnerOnMissingPermission) {
                setTimeout(function() {
                    g.owner.send("Hello!\n\nThis bot requires the `MANAGE_GUILD` permission to allow for the invite manager section of the bot to work.\n\nIf you do not turn on the permission, the bot cannot track incoming invites!");
                }, delay);
                delay += 1000;
            }
        })
    });

    var inviteSettings;
    var inviteData;
    var invitePData;
    var inviterData;
    var invitedData;

    if (globalVars("inviteManagerDataMoved") == null) {
        Files.saveGlobalVariable("inviteManagerDataMoved", true);

        if (!fs.existsSync(`./data/inviteManager`)) {
            fs.mkdirSync(`./data/inviteManager`);
        }

        ["inviteManagerSettings", "inviteManagerInviteData", "inviteManagerData"].forEach(fileName => {
            if (fs.existsSync(`./data/${fileName}.json`)) {
                fs.renameSync(`./data/${fileName}.json`, `./data/inviteManager/${fileName}.json`);
            }
        });


    }

    checkReadFile("inviteManagerData", {
        "inviterData": {},
        "invitedData": {}
    }, "invitePData").then(() => {
        invitePData = Actions.invitePData;
        inviterData = Actions.invitePData["inviterData"];
        invitedData = Actions.invitePData["invitedData"];
    }).catch();

    checkReadFile("inviteManagerSettings", {}, "inviteSettings").then(() => {
        inviteSettings = Actions.inviteSettings;
    }).catch();

    checkReadFile("inviteManagerInviteData", {}, "inviteData").then(async () => {
        if (globalVars("inviteManagerDataConvertedOnce") == null) {
            Files.saveGlobalVariable("inviteManagerDataConvertedOnce", true);
            inviteData = Actions.inviteData;

            var inviteDataKeys = Object.keys(inviteData);

            var lastInviteKey = inviteDataKeys[inviteDataKeys.length - 1];

            for (var key in inviteData) {
                if (Array.isArray(inviteData[key])) {
                    var base = {
                        "inviter": "0",
                        "codeCreated": "0",
                        "uses": 0,
                        "playersTracked": inviteData[key]
                    };

                    await client.fetchInvite(key).then(inviteObj => {
                        base["inviter"] = inviteObj.inviter.id;
                        base["codeCreated"] = inviteObj.createdAt;
                        base["uses"] = inviteObj.uses;

                        inviteData[key] = base;
                    }).catch(error => {
                        inviteData[key] = base;
                    })
                }

                if (lastInviteKey == key) {
                    writeToData("inviteManagerInviteData", inviteData, "inviteData");
                }
            }

        } else {
            inviteData = Actions.inviteData;
        }
    }).catch();

    client.on('guildMemberAdd', (member) => {
        var memberGuild = member.guild;
        var memberGuildID = memberGuild.id;

        var guildInv = inviteDatabase[memberGuildID];
        memberGuild.fetchInvites().then(guildInvites => {
            inviteDatabase[memberGuildID] = guildInvites;
            const invited = guildInvites.find(i => guildInv.get(i.code).uses < i.uses);

            if (invited != null) {
                client.users.fetch(invited.inviter.id).then(inviter => {
                    var inviterID = inviter.id.toString();
                    var invitedID = member.id.toString();

                    if (!checkProperty(inviteData, invited.code)) {
                        inviteData[invited.code] = {
                            "inviter": inviterID,
                            "codeCreated": invited["createdAt"],
                            "uses": invited["uses"],
                            "playersTracked": []
                        };
                    }

                    var memInviteDataIndex = inviteData[invited.code]["playersTracked"].findIndex(memberN => memberN == member.id);
                    inviteData[invited.code]["playersTracked"]["uses"] = invited["uses"];
                    if (memInviteDataIndex == -1) {
                        inviteData[invited.code]["playersTracked"].push(member.id);
                    } else {
                        inviteData[invited.code]["playersTracked"].splice(memInviteDataIndex, 1);
                        inviteData[invited.code]["playersTracked"].push(member.id);
                    }

                    writeToData("inviteManagerInviteData", inviteData, "inviteData");


                    var memberTime = member.user.createdTimestamp / 1000;
                    var currentTime = Math.floor(Date.now() / 1000);

                    var memberAge = Math.floor((currentTime - memberTime) / 86400);


                    if (!checkProperty(inviterData, memberGuildID)) {
                        inviterData[memberGuildID] = {};
                    }
                    if (!checkProperty(inviterData[memberGuildID], inviterID)) {
                        inviterData[memberGuildID][inviterID] = {
                            "invites": [],
                            "data": {
                                "real": 0,
                                "invalid": 0
                            }
                        };
                    }



                    if (!checkProperty(invitedData, memberGuildID)) {
                        invitedData[memberGuildID] = {};
                    }
                    if (!checkProperty(invitedData[memberGuildID], invitedID)) {
                        invitedData[memberGuildID][invitedID] = []
                    }


                    var inviterDataFile = inviterData[memberGuildID][inviterID];
                    var invitedDataFile = invitedData[memberGuildID][invitedID];

                    for (i = 0; i < inviterDataFile["invites"].length; i++) {
                        if (inviterDataFile["invites"][i]["id"] == invitedID) {
                            if (inviterDataFile["invites"][i]["valid"]) {
                                inviterDataFile["data"]["real"] -= 1;
                            } else {
                                inviterDataFile["data"]["invalid"] -= 1;
                            }
                            inviterDataFile["invites"].splice(i, 1);
                        }
                    }

                    inviterDataFile["invites"].push({
                        "id": member.id,
                        "time": currentTime,
                        "codeUsed": invited.code,
                        "valid": true,
                        "invalidCause": ""
                    });

                    if (checkProperty(inviteSettings, memberGuildID) && inviteSettings[memberGuildID]["invalidize"]["age_check"]["enabled"]) {
                        if (memberAge >= inviteSettings[memberGuildID]["invalidize"]["age_check"]["minimum"]) {
                            inviterDataFile["data"]["real"] += 1;
                        } else {
                            var latestIndex = inviterDataFile["invites"].length - 1;
                            inviterDataFile["invites"][latestIndex].valid = false;
                            inviterDataFile["invites"][latestIndex].invalidCause = "Player did not meet the minimum account age on join.";
                            inviterDataFile["data"]["invalid"] += 1;
                        }
                    } else {
                        inviterDataFile["data"]["real"] += 1;
                    }

                    for (i = 0; i < invitedDataFile.length; i++) {
                        if (invitedDataFile[i] == inviterID) {
                            invitedDataFile.splice(i, 1);
                        }
                    }

                    invitedDataFile.push(inviterID);

                    writeToData("inviteManagerData", invitePData, "invitePData");

                    if (checkProperty(inviteSettings, memberGuildID) && inviteSettings[memberGuildID]["logging"]["enabled"]) {

                        var fetchedChannel = memberGuild.channels.cache.get(inviteSettings[memberGuildID]["logging"]["channel"]);

                        if (fetchedChannel != null) {


                            var guildData = inviterData[memberGuildID];
                            var inviteArr = [];

                            var objectKeys = Object.keys(guildData);

                            sortedItems = "";
                            for (i = 0; i < objectKeys.length; i++) {
                                var keyIndex = objectKeys[i];
                                guildData[keyIndex]["id"] = keyIndex;
                                inviteArr.push(guildData[keyIndex]);
                            }

                            var sortedArr = inviteArr.sort(function(a, b) {
                                return b["data"]["real"] - a["data"]["real"]
                            });

                            var leaderboardStanding = sortedArr.findIndex(userData => userData["id"] == inviterID) + 1;

                            var format = inviteSettings[memberGuildID]["logging"]["format"]
                            fetchedChannel.send({
                                embed: {
                                    title: `Welcome to ${memberGuild.name}!`,
                                    description: format.replace(/{user1}/g, `${member}`).replace(/{user2}/g, `${inviter}`).replace(/{code}/g, `${invited.code}`).replace(/{uses}/g, `${invited.uses}`),
                                    thumbnail: {
                                        url: member.user.avatarURL(),
                                    },
                                    fields: [{
                                            name: '👤 Inviter',
                                            value: inviter,
                                            inline: true,
                                        },
                                        {
                                            name: '✅ Real Invites',
                                            value: inviterDataFile["data"]["real"],
                                            inline: true,
                                        },
                                        {
                                            name: '🏆 Rank',
                                            value: `#${leaderboardStanding}`,
                                            inline: true,
                                        }
                                    ],
                                    "color": 0x00ff00,
                                    timestamp: new Date()
                                }
                            });
                        } else {
                            inviteSettings[memberGuildID]["logging"]["enabled"] = false;
                            inviteSettings[memberGuildID]["logging"]["channel"] = "0";

                            writeToData("inviteManagerSettings", inviteSettings, "inviteSettings");
                        }

                    }

                }).catch(error => {
                    //
                })
            } else {
                if (checkProperty(inviteSettings, memberGuildID) && inviteSettings[memberGuildID]["logging"]["enabled"]) {
                    var fetchedChannel = memberGuild.channels.cache.get(inviteSettings[memberGuildID]["logging"]["channel"]);
                    if (fetchedChannel != null) {
                        if (memberGuild.vanityURLCode != null) {
                            msg.guild.fetchVanityData()
                                .then(res => {
                                    fetchedChannel.send({
                                        embed: {
                                            title: `Welcome to ${memberGuild.name}!`,
                                            description: `${member} has joined using the vanity url (https://discord.gg/${res.coode})\n\n(${res.uses} Uses)`,
                                            thumbnail: {
                                                url: member.user.avatarURL(),
                                            },
                                            "color": 0x00ff00,
                                            timestamp: new Date()
                                        }
                                    });
                                    console.log(`Vanity URL: https://discord.gg/${res.code} with ${res.uses} uses`);
                                })
                                .catch(console.error);
                        }
                    }
                }
            }
        }).catch();
    });

    client.on('guildMemberRemove', async (member) => {
        var memberGuild = member.guild;
        var memberGuildID = memberGuild.id;

        if (checkProperty(invitedData, memberGuildID) && checkProperty(invitedData[memberGuildID], member.id) && invitedData[memberGuildID][member.id].length != 0) {
            var memberInviters = invitedData[memberGuildID][member.id];
            var inviterDataFile = inviterData[memberGuildID][memberInviters[memberInviters.length - 1]];

            var findInviteIndex = inviterDataFile["invites"].findIndex(inviteMem => inviteMem.id == member.id);
            if (inviterDataFile["invites"][findInviteIndex]["valid"]) {
                inviterDataFile["invites"][findInviteIndex]["valid"] = false;
                inviterDataFile["invites"][findInviteIndex]["invalidCause"] = "User had left the server";

                inviterDataFile["data"]["invalid"] += 1;
                inviterDataFile["data"]["real"] -= 1;
            }

            writeToData("inviteManagerData", invitePData, "invitePData");
        }
    });

    client.on('guildCreate', (guild) => {
        guild.fetchInvites(invites => {
            inviteDatabase[guild.id] = invites;
        }).catch(error => {
            if (dmOwnerOnMissingPermission) {
                g.owner.send("Hello!\n\nThis bot requires the `MANAGE_GUILD` permission to allow for the invite manager section of the bot to work.\n\nIf you do not turn on the permission, the bot cannot track incoming invites!");
            }
        })
    });

    client.on('inviteCreate', (invite) => {
        if (inviteDatabase[invite.guild.id] == null) {
            inviteDatabase[invite.guild.id] = new Map();
        }
        inviteDatabase[invite.guild.id].set(invite.code, invite);
    })

    function checkReadFile(name, format, dataname) {
        return new Promise(function(resolve) {
            if (fs.existsSync(`./data/inviteManager/${name}.json`)) {
                fs.readFile(`./data/inviteManager/${name}.json`, function read(err, data) {
                    if (err) {
                        throw err;
                    }
                    data = JSON.parse(data)

                    Actions[dataname] = data;

                    resolve(data);
                });
            } else {
                Actions[dataname] = format;
                writeToData(name, format, dataname);
                resolve(format);
            }
        })
    }

    function writeToData(name, data, dataname) {
        fs.writeFile(`./data/inviteManager/${name}.json`, JSON.stringify(data), function(err) {
            if (err) {
                return console.log(err);
            }
            Actions[dataname] = data;
        });
    }

    function checkProperty(item, check) {
        try {
            if (item[check] == null) {
                return false;
            } else {
                return true;
            }
        } catch (error) {
            return false;
        }
    }
}

